import React from 'react';
import Grid from '@material-ui/core/Grid';
import JournalCard from './JournalCard.jsx';
import JournalEditor from './components/JournalEditor.jsx';
import MonthBreak from './MonthBreak.jsx';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles(theme => ({
    root: {
        margin: "0 5rem",
    },
    addBtn: {
        background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
        border: 0,
        borderRadius: 3,
        boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
        color: 'white',
        height: 48,
        padding: '0 30px',
    }
}));

export default function JournalGrid({ data }) {
    const classes = useStyles();


    // const renderEntries = () => (
    //     // Loop through the entries and render a grid 
    //     for(i = 0; i < data.length; ++i) {

    //     }
    //     return entryGridItems;      ;
    return (
        <div class={classes.root}>
            <Grid container spacing={3}>
                <Grid item xs={12} md={4} lg={3}>
                    <Button variant="outlined" size="large" className={classes.addBtn}>
                        Large
                    </Button>
                </Grid>
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="http://pixelartmaker.com/art/5da075d9350e793.png"
                        title="Shopping" />
                </Grid >
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080"
                        title="Brunch with friends" />
                </Grid >
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="https://img.freepik.com/free-vector/collection-with-flat-summer-fruit_23-2147551070.jpg?size=338&ext=jpg"
                        title="worked out" />
                </Grid >
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080"
                        title="went to Japan" />
                </Grid >
                <Grid item xs={12}>
                    <MonthBreak date={new Date()}></MonthBreak>
                </Grid>
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080" />
                </Grid >
            </Grid>
        </div>
    );
}
